import { Button } from "react-bootstrap";
import Form from "react-bootstrap/Form";
import "../Stylesheets/Contact.css"
export default function Contact({ contactRef }) {
    const description = "I'm deeply passionate about software development and machine learning, and I'm eager to collaborate with professionals who share the same enthusiasm. If you're interested in connecting, please don't hesitate to reach out to me on LinkedIn or directly via the form provided below:"
  return (
    <>
      <div className="contact" ref={contactRef}>
        <div className="contact header">Contact Me:</div>
        <div className="flex flex-row">

        </div>

      </div>
    </>
  );
}
